```suggestion
  async removeBlogEditorAsync(username: string): Promise<void> {
    this.http.put<void>(
      '/blogadminrolehandler', {
        username: username,
      }
    ).toPromise()
  }
```
If returning the errorCode is important, I would strongly recommend using Observables and not converting it to Promise.
Here is how it would go:
 ```suggestion
  async removeBlogEditorAsync(username: string): Observable<void> {
    this.http.put<void>(
      '/blogadminrolehandler', {
        username: username,
      }
    ).pipe(catchError(err => throwError(err.error.error));
  }
```
